query:
fragment ShippingErrorFragment on ShippingError {
  code
  field
  __typename
}

fragment ShippingZoneFragment on ShippingZone {
  id
  countries {
    code
    country
    __typename
  }
  name
  __typename
}

fragment ShippingMethodFragment on ShippingMethod {
  id
  minimumOrderPrice {
    amount
    currency
    __typename
  }
  minimumOrderWeight {
    unit
    value
    __typename
  }
  maximumOrderPrice {
    amount
    currency
    __typename
  }
  maximumOrderWeight {
    unit
    value
    __typename
  }
  name
  price {
    amount
    currency
    __typename
  }
  type
  __typename
}

fragment ShippingZoneDetailsFragment on ShippingZone {
  ...ShippingZoneFragment
  default
  shippingMethods {
    ...ShippingMethodFragment
    __typename
  }
  warehouses {
    id
    name
    __typename
  }
  __typename
}

mutation CreateShippingRate($input: ShippingPriceInput!) {
  shippingPriceCreate(input: $input) {
    errors: shippingErrors {
      ...ShippingErrorFragment
      __typename
    }
    shippingZone {
      ...ShippingZoneDetailsFragment
      __typename
    }
    __typename
  }
}
